import './ExpenseItem.css';

function ExpenseItem(myTitle, myPrice, myDate) {
  return (
    <div className="expense-item">
      <div>{myTitle.date.toDateString()}</div>
      <div className="expense-item__description">
        <h2>{myPrice.title}</h2>
        <div className="expense-item__price">{myDate.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
